import React from "react";
import { Helmet } from "react-helmet";

export default class  EXTJS extends React.Component {
    render() {
        return (
            <div className="application">
                <Helmet>
                    <script
                        type="text/javascript"
                        src="assets/js/jquery/jquery.min.js"/>
                    

                </Helmet>
          
            </div>
        );
    }
};
